class Video {  final String id;  final String title;  final String? uploader;  final String? thumbnail;  final DateTime? publishedAt;  String? pulishedAtStr;  final String? description;  Video(      {required this.title,      required this.id,      this.uploader,      this.thumbnail,      this.publishedAt,      this.pulishedAtStr,      this.description}) {    if (this.pulishedAtStr == null) {      this.pulishedAtStr = this.publishedAt?.toString() ?? "Unknown";    }  }  @override  String toString() {    return 'ID: $id , Title: $title, Uploader: $uploader, Published At: $pulishedAtStr';  }}